import React, { Component } from 'react'
import SummarySection from './SummarySection';

export default class Summary extends Component {
    constructor(props) {
        super(props);
    }
  render() {
    return (
      <section className="totalQuestions">
          {this.props.summary.map((el) => {
            return (
              <>
              <div>{el.questionType}</div>
              <div>{el.correctAnswers}</div>
              /
              <div>{el.totalAnswers}</div>
              </>
            );
          })}
      </section>

    )
  }
}
